var recordId = Get<Guid>("SrmRecordId");
var artifactId = Get<Guid>("SrmArtifact");
var artifactVarietyId = Get<Guid>("SrmArtifactVariety");
var matrixCoordinationsIds = GetMatrixCoordinationsIds(artifactVarietyId);

if (matrixCoordinationsIds.IsEmpty())
{
	return true;
}

var approvalObjectSchemaUId = GetArtifactApprovalObjectSchemaUId(artifactId);
var approvalObjectSchema = UserConnection.EntitySchemaManager.GetInstanceByUId(approvalObjectSchemaUId);
var approvalObject = approvalObjectSchema.CreateEntity(UserConnection);

if (!approvalObject.FetchFromDB(recordId))
{
	return true;
}

foreach (var matrixCoordinationId in matrixCoordinationsIds)
{
	if (IsMatrixConditionsSuitable(matrixCoordinationId, approvalObject))
	{
		Set("SrmMatrixCoordination", matrixCoordinationId);
		break;
	}
}

return true;

