/// <summary>
/// Возвращает идентификаторы матриц согласования по идентификатору вида артефакта.
/// </summary>
/// <param name="artifactVarietyId">Идентификатор вида артефакта.</param>
/// <returns>Идентификаторы матриц согласования.</returns>
public Guid[] GetMatrixCoordinationsIds(Guid artifactVarietyId)
{
    var select = new Select(UserConnection)
        .Column(nameof(SrmMatrixCoordination.Id))
        .From(nameof(SrmMatrixCoordination))
        .Where(nameof(SrmMatrixCoordination.SrmArtifactVarietyId))
        .IsEqual(Column.Parameter(artifactVarietyId))
        .OrderByDesc(nameof(SrmMatrixCoordination.CreatedOn)) as Select;

    return select.ExecuteEnumerable(x => x.GetColumnValue<Guid>(nameof(SrmMatrixCoordination.Id)))
        .ToArray();
}

/// <summary>
/// Возвращает идентификатор схемы объекта согласования артефакта.
/// </summary>
/// <param name="artifactId">Идентификатор артефакта.</param>
/// <returns>Идентификатор схемы объекта согласования.</returns>
public Guid GetArtifactApprovalObjectSchemaUId(Guid artifactId)
{
	var select = new Select(UserConnection)
		.Column("o", nameof(SrmApprovalObject.SrmSchemaUId))
		.From(nameof(SrmArtifact)).As("a")
			.InnerJoin(nameof(SrmApprovalObject)).As("o")
			.On("a", nameof(SrmArtifact.SrmReconcilingObjectId))
			.IsEqual("o", nameof(SrmApprovalObject.Id))
		.Where("a", nameof(SrmArtifact.Id))
		.IsEqual(Column.Parameter(artifactId)) as Select;

	return select.ExecuteScalar<Guid>();
}

public bool IsMatrixConditionsSuitable(Guid matrixCoordinationId, Entity approvalObject)
{
	var esq = new EntitySchemaQuery(UserConnection.EntitySchemaManager, nameof(SrmMatrixConditions));
	esq.PrimaryQueryColumn.IsAlwaysSelect = true;
	esq.UseAdminRights = true;
	esq.AddColumn(nameof(SrmMatrixConditions.SrmValue));
	esq.AddColumn(nameof(SrmMatrixConditions.SrmComparisonOperator));
	esq.AddColumn("SrmField.SrmColumnUId").Name = "SrmFieldColumnUId";

	esq.Filters.Add(esq.CreateFilterWithParameters(
		FilterComparisonType.Equal,
		nameof(SrmMatrixConditions.SrmMatrixCoordination),
		matrixCoordinationId));

	var matrixConditions = esq.GetEntityCollection(UserConnection);

	if (matrixConditions.IsEmpty())
	{
		return false;
	}

	foreach (var matrixCondition in matrixConditions)
	{
		var value = matrixCondition.GetTypedColumnValue<string>(nameof(SrmMatrixConditions.SrmValue));
		var comparisonOperatorId = matrixCondition.GetTypedColumnValue<Guid>(nameof(SrmMatrixConditions.SrmComparisonOperatorId));
		var columnUId = matrixCondition.GetTypedColumnValue<Guid>("SrmFieldColumnUId");
		var column = approvalObject.Schema.Columns.GetByUId(columnUId);
		var columnValue = approvalObject.GetTypedColumnValue<Guid>(column.ColumnValueName);

		Guid.TryParse(value, out var idValue);

		if (!IsConditionCorrect(columnValue, idValue, comparisonOperatorId))
		{
			return false;
		}
	}

	return true;
}

