/// <summary>
/// Проверяет, корректно ли условие сравнения двух идентификаторов.
/// </summary>
/// <param name="first">Первый идентификатор.</param>
/// <param name="second">Второй идентификатор.</param>
/// <param name="conditionId">Оператор сравнения.</param>
/// <returns>true, если корректно, иначе false.</returns>
public bool IsConditionCorrect(Guid first, Guid second, Guid conditionId)
{
	switch(conditionId)
	{
		case var _ when SrmApprovalServiceConstantsCS.SrmComparisonOperator.Equal.Equals(conditionId):
			return first.Equals(second);
		case var _ when SrmApprovalServiceConstantsCS.SrmComparisonOperator.Greater.Equals(conditionId):
			return first.CompareTo(second) > 0;
		case var _ when SrmApprovalServiceConstantsCS.SrmComparisonOperator.GreaterOrEqual.Equals(conditionId):
			return first.CompareTo(second) >= 0;
		case var _ when SrmApprovalServiceConstantsCS.SrmComparisonOperator.Less.Equals(conditionId):
			return first.CompareTo(second) < 0;
		case var _ when SrmApprovalServiceConstantsCS.SrmComparisonOperator.LessOrEqual.Equals(conditionId):
			return first.CompareTo(second) <= 0;
		case var _ when SrmApprovalServiceConstantsCS.SrmComparisonOperator.NotEmpty.Equals(conditionId):
			return !Guid.Empty.Equals(first);
		case var _ when SrmApprovalServiceConstantsCS.SrmComparisonOperator.Empty.Equals(conditionId):
			return Guid.Empty.Equals(first);
		default: 
			return false;
	}
}
